import React from "react";

export default function Semcard(props){
  return (
    <div className="relative">
      <div className="absolute z-10 h-48 w-48 top-0 left-0 bg-white border-4 border-gray-800">
        <p className="font-bold text-5xl">{props.sem}</p>
      </div>
      <div className="absolute z-0 h-48 w-48 top-5 left-5 bg-green-200 border-4 border-gray-800"></div>
    </div>
  );
}
